@use 'config' as c;

@mixin tablets {
  @media screen and (max-width: 768px) {
    .header {
      & .header-items {
        & #nav-list {
          @include c.flex(row);
          width: 300px;
        }
      }
    }

    .hero {
      @include c.flex(column);

      & .hero-contents {
        position: relative;
        width: 100%;
        margin-right: 0px;
        text-align: center;
        margin-bottom: 50px;
        // z-index: 100;
        & .hero-heading {
          font-size: 55px;
        }

        & .hero-copy {
          font-size: 20px;
          margin: 10px 0 20px;
        }
      }

      & .hero-img-container {
        width: 100%;
        padding-right: 40px;
        & .hero-imgs {
          width: 100%;
          @include c.flex(row);

          & img {
            width: 33.33%;
            &:not(:last-child) {
              margin-right: 20px;
            }
            &:nth-child(odd) {
              transform: translateY(50px);
            }
          }
        }
      }
    }
  }
}

@mixin mobiles {
  @media screen and (max-width: 500px) {
    .header {
      & .header-items {
        // position: relative;

        & #nav-list {
          position: absolute;
          background: transparent;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
          z-index: 70;
          @include c.flex(column);
          transform: translateX(-100%);
          @include c.transition;
          align-items: center;
          justify-content: center;
          transition-delay: 0.4s;
          overflow: hidden;
          // z-index: 20;

          &.open {
            transform: translateX(0);
          }

          & .nav-item {
            font-size: 30px;
            @include c.transition;

            &:nth-child(even) {
              transform: translateX(-400%);
              &.open {
                transform: translateX(-30px);
              }
            }
            &:nth-child(odd) {
              transform: translateX(400%);
              &.open {
                transform: translateX(30px);
              }
            }

            &:not(:last-child) {
              margin-bottom: 60px;
            }
          }
        }

        & #nav-actions {
          position: relative;
          z-index: 120;
          @include c.flex(row);
          & i {
            cursor: pointer;
            @include c.transition;

            &:hover {
              color: c.$dark-milk;
            }
          }

          & i:nth-child(2) {
            margin-left: 10px;
          }

          & .nav-toggler {
            width: 30px;
            height: 25px;
            cursor: pointer;
            @include c.flex(column);
            margin-left: 20px;
          }
        }
      }
    }
  }
}

.blocks {
  @include c.flex(row);
}

@for $i from 1 through 5 {
  .blocks {
    & .block:nth-child(#{$i}) {
      transition-delay: ($i * 0.18s);
    }
  }
}

